import React from "react";
import { Link } from "react-router-dom";
import './App.css'

const listStyle = {
  display: "grid",
};
  const subListStyle = {
  display: "grid",
  };
  
const Exercise = (props) => {
  <tr style={listStyle}>
    <td style={subListStyle}>{props.exercise.username}</td>
    <td style={subListStyle}>{props.exercise.description}</td>
    <td style={subListStyle}>{props.exercise.duration}</td>
    <td style={subListStyle}>{props.exercise.date.substring(0, 10)}</td>
    <td style={subListStyle}>
      <button>
        <Link to={"/edit/" + props.exercise._id}>Edit</Link>
      </button>{" "}
      <button
        onClick={() => {
          props.deleteExercise(props.exercise._id);
        }}>
        Delete
      </button>
    </td>
  </tr>
};

export default Exercise;
